import React from 'react';
import '../C_login/style_login.css';

function Password() {
  
    return (    
      <div class="login_password"> 
        <label for="password">Password:</label>
        <input type="password" placeholder="Password"></input>        
        <br></br>
      </div>
    );
  }
  
  export default Password;
